import React from "react";

const TaskGrid = () => {
  return (
    <table className='taskGrid' >
      <thead>
        <tr>
          <th></th>
          <th>Name</th>
          <th>Description</th>
          <th>Estimate</th>
          <th>State</th>
        </tr>
      </thead>     
      <tbody>
        <tr>
          <td><input type='checkbox'></input></td>
          <td>Make Grid</td>
          <td>Do the grid for tasks program</td>
          <td>3 days</td>
          <td>In progress</td> 
        </tr>
      </tbody> 
    </table>
  );
};

export default TaskGrid;
